import React, { useState, useEffect } from 'react';
import confetti from 'canvas-confetti';

// --- SUB-COMPONENT: SCRATCH CARD ---
const ScratchBox = ({ reward, onScratch }) => {
  const [scratched, setScratched] = useState(false);
  return (
    <div 
      onClick={() => { if (!scratched) { setScratched(true); onScratch(reward); confetti({ particleCount: 15 }); } }}
      style={{ ...styles.scratchCardMini, ...(scratched ? styles.scratchCardRevealed : {}) }}
    >
      {!scratched ? <div style={styles.scratchOverlayMini}>SCRATCH</div> : <div style={styles.rewardTextMini}>{reward}</div>}
    </div>
  );
};

const App = () => {
  const [phase, setPhase] = useState('loading');
  const [progress, setProgress] = useState(0);
  const [hackerText, setHackerText] = useState('');
  const [upgrades, setUpgrades] = useState({ patience: 80, romance: 90, naughty: 50 });

  // DATE & ANIMATION STATE
  const [targetDate, setTargetDate] = useState('');
  const [displayDate, setDisplayDate] = useState(new Date().toLocaleDateString());
  const [isWarping, setIsWarping] = useState(false);

  useEffect(() => {
    if (phase === 'loading') {
      const interval = setInterval(() => {
        setProgress((prev) => {
          if (prev >= 100) { clearInterval(interval); setTimeout(() => setPhase('prank'), 800); return 100; }
          return prev + 1;
        });
      }, 30);
      return () => clearInterval(interval);
    }

    if (phase === 'warping') {
      let count = 0;
      const warpInterval = setInterval(() => {
        const tempDate = new Date();
        tempDate.setDate(tempDate.getDate() + count);
        setDisplayDate(tempDate.toLocaleDateString());
        count++;
        if (count > 20 || tempDate.toLocaleDateString() === new Date(targetDate).toLocaleDateString()) {
          clearInterval(warpInterval);
          setDisplayDate(new Date(targetDate).toLocaleDateString());
          confetti({ particleCount: 200, spread: 100, origin: { y: 0.6 } });
          setTimeout(() => setPhase('final-choice'), 2000);
        }
      }, 100);
    }
  }, [phase, targetDate]);

  const handleSendWhatsApp = () => {
    const summary = `üî• MISSION COMPLETE! \n‚ù§Ô∏è Upgrades: P:${upgrades.patience}% R:${upgrades.romance}% N:${upgrades.naughty}% \nüìÖ Scheduled: ${targetDate} \nüîû Destination: BEDROOM (Forced Choice) \n\nSee you there! üòâ`;
    window.location.href = `https://wa.me/?text=${encodeURIComponent(summary)}`;
  };

  return (
    <div style={styles.container}>
      <style>{animations}</style>

      {/* PHASE 1 & 2: LOADING & PRANK (Existing Logic) */}
      {phase === 'loading' && (
        <div style={styles.card}>
          <div style={styles.spinner}>üíñ</div>
          <h2 style={styles.title}>Upgrading Sourav...</h2>
          <div style={styles.progressBarOuter}><div style={{ ...styles.progressBarInner, width: `${progress}%` }} /></div>
        </div>
      )}

      {phase === 'prank' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Will you be my Valentine?</h2>
          <button onClick={() => setPhase('configurator')} style={styles.btnYes}>YES! üåπ</button>
        </div>
      )}

      {/* PHASE 3: CONFIGURATOR */}
      {phase === 'configurator' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Configure Me</h2>
          <div style={styles.sliderGroup}>
            <label style={styles.label}>Naughtiness: {upgrades.naughty}%</label>
            <input type="range" style={styles.slider} value={upgrades.naughty} onChange={(e) => setUpgrades({...upgrades, naughty: e.target.value})} />
          </div>
          <button onClick={() => setPhase('calendar')} style={{...styles.btnYes, width: '100%', marginTop: '20px'}}>NEXT</button>
        </div>
      )}

      {/* PHASE 6: SELECT A DATE (CALENDAR) */}
      {phase === 'calendar' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Pick a Date üìÖ</h2>
          <p style={styles.text}>When are we going out?</p>
          <input 
            type="date" 
            style={styles.dateInput} 
            onChange={(e) => setTargetDate(e.target.value)}
          />
          <button 
            disabled={!targetDate}
            onClick={() => setPhase('warping')} 
            style={{...styles.btnYes, width: '100%', marginTop: '20px', opacity: targetDate ? 1 : 0.5}}
          >
            CONFIRM DATE
          </button>
        </div>
      )}

      {/* PHASE 7: WARPING ANIMATION */}
      {phase === 'warping' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Fast Forwarding... üöÄ</h2>
          <div style={styles.warpText}>{displayDate}</div>
          <p style={styles.text}>Traveling to our special day!</p>
        </div>
      )}

      {/* PHASE 8: THE FAKE CHOICE */}
      {phase === 'final-choice' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Hooray! It's {new Date(targetDate).toDateString()}! üéâ</h2>
          <p style={styles.text}>What's the plan for tonight?</p>
          <div style={styles.choiceGrid}>
            {['Movie üé¨', 'Candle Light üïØÔ∏è', 'Bedroom ü´¶'].map(choice => (
              <button 
                key={choice} 
                style={styles.btnChoice}
                onClick={() => {
                  alert(`System Error: You accidentally clicked '${choice}', but your heart actually chose BEDROOM! üòà`);
                  setPhase('naughty-coupon');
                }}
              >
                {choice}
              </button>
            ))}
          </div>
        </div>
      )}

      {/* PHASE 9: FINAL SCRATCH & WHATSAPP */}
      {phase === 'naughty-coupon' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Destination: Bedroom ü´¶</h2>
          <p style={styles.text}>Scratch your bedroom penalties:</p>
          <div style={styles.scratchGrid}>
            {["Oil Massage", "Wild Round 2", "Blindfolded", "Yes Night"].map((r, i) => (
              <ScratchBox key={i} reward={r} onScratch={() => {}} />
            ))}
          </div>
          <button onClick={handleSendWhatsApp} style={styles.btnWa}>
            ENTER THE BEDROOM ‚úÖ
          </button>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: { height: '100vh', width: '100vw', display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor: '#ffe5ec', fontFamily: 'cursive', textAlign: 'center' },
  card: { padding: '25px', borderRadius: '30px', backgroundColor: 'white', boxShadow: '0 20px 50px rgba(255, 77, 109, 0.3)', maxWidth: '380px', width: '90%' },
  title: { color: '#ff4d6d', fontSize: '1.4rem' },
  text: { color: '#555', fontSize: '0.85rem' },
  dateInput: { width: '100%', padding: '15px', borderRadius: '15px', border: '2px solid #ff4d6d', marginTop: '10px', fontSize: '1rem', outline: 'none' },
  warpText: { fontSize: '2.5rem', fontWeight: 'bold', color: '#ff4d6d', margin: '20px 0', animation: 'pulse 0.5s infinite' },
  choiceGrid: { display: 'flex', flexDirection: 'column', gap: '10px', marginTop: '20px' },
  btnChoice: { padding: '15px', borderRadius: '15px', border: '2px solid #ff4d6d', backgroundColor: '#fff', cursor: 'pointer', fontWeight: 'bold' },
